import React from "react";

const Rank = ({ name, entries }) => {
  return (
    <>
      <div className="white f3">
        {`${name},our current count of entries is..`}
        {console.log(entries)}
      </div>
      <div className="white f1">{entries}</div>
    </>
  );
};

export default Rank;
